export default function add() {
  return (
    <div className="form">
        <h1>Add New Book</h1>
        <input type="text" placeholder='title'/>
        <input type="text" placeholder='desc'/>
        <input type="text" placeholder='cover'/>
        <input type="text" placeholder='price'/>

    </div>
  )
}
